import React, { useState } from "react";
import { api_url } from "../src/config/Config";
import _fetch from "./config/api";
import toasted from "./config/toast";


export default function Register() {

    const [allFields, setAllFields] = useState({
        'name': "",
        'email': "",
        'phone': "",
        'password': ""
    });

    const handleChange = (event) => {
        console.log('event',event);

        setAllFields({
            ...allFields,
            [event.target.name]: event.target.value
        })
    }

    const SubmitRegister = async () => {
        let response = await _fetch(`${api_url}auth/register`, "POST", allFields, {});
        console.log(response);
        if (response?.status == 'success') {
            toasted.success(response?.message);
        }
        else {
            toasted.error(response?.message);
        }
    }

    return (
        <>
            <div className="main-div-for-form">
                <div className="form-container">
                    <form className="form">
                        <h2 className="form-title"> Register </h2>
                        <div className="form-group">
                            <label htmlFor="field1" className="form-label">Name</label>
                            <input type="text" id="field1" className="form-input" placeholder="Enter text here" value={allFields?.name} onChange={handleChange} />
                        </div>
                        <div className="form-group">
                            <label htmlFor="field2" className="form-label">Email</label>
                            <input type="text" id="field2" className="form-input" placeholder="Enter text here" value={allFields?.email} onChange={handleChange} />
                        </div>
                        <div className="form-group">
                            <label htmlFor="field3" className="form-label">Phone</label>
                            <input type="text" id="field3" className="form-input" placeholder="Enter text here" value={allFields?.phone} onChange={handleChange} />
                        </div>
                        <div className="form-group">
                            <label htmlFor="field4" className="form-label">Password</label>
                            <input type="text" id="field4" className="form-input" placeholder="Enter text here" value={allFields?.password} onChange={handleChange} />
                        </div>
                        <button type="submit" className="form-button" onClick={SubmitRegister}>Submit</button>
                    </form>
                </div>
            </div>
        </>
    )
}
